export default (function(a,b,c,d){return {data:{kSvZKrbZTk:{data:{id:2121,attributes:{imdbId:"tt0054195",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTdiMDQ5NTEtM2FjNS00YTFkLWExZTAtYjk5Mjc0YTMzYWM1XkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.4\u002F10"},{Source:"Rotten Tomatoes",Value:"86%"}],item_lang:{data:{id:2784,attributes:{title:b,plot:"A little girl comes to a town that is embattled by feuds and intimidated by her aunt. By the time she must leave, she has transformed the community with her indominatable will to see the good side of even the worst situations and bring it out for the betterment of all.",slug:"pollyanna"}}},books:{data:[{id:10482,attributes:{title:b,description:"Pollyanna is a best-selling novel by Eleanor H. Porter that is now considered a classic of children's literature. The book was such a success that Porter soon produced a sequel, Pollyanna Grows Up (ISBN 9781439297513 ). The novel's success brought the term \"Pollyanna\" (along with the adjective \"pollyannaish\" and the noun \"Pollyannaism\") into the language to describe someone who seems always to be able to find something to be \"glad\" about no matter what circumstances arise.",thumbnail:a,authors:[d],firstBook:true,published:"2009-11-09",publisher:a,subtitle:a}},{id:10483,attributes:{title:"Pollyanna - Eleanor H.Porter (Stage-5)",description:"The orphan girl Pollyanna moves in with her strict aunt in New England. Despite a difficult start, Pollyannas exuberance and positivity affect everyone who meets her, and she spreads joy and love wherever she goes. But when tragedy strikes, Pollyanna finds her optimistic attitude tested, and she must learn to find happiness again.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=CzT-DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Eleanor H.Porter"],firstBook:c,published:"1000-01-01",publisher:"Maviçatı Yayınları",subtitle:a}},{id:10484,attributes:{title:b,description:"As soon as Pollyanna arrives in Beldingsville to live with her strict and dutiful maiden aunt, she begins to brighten up everybody's life. The 'glad game' she plays, of finding a silver lining in every cloud, transforms the sick, the lonely and the plain miserable - until one day something so terrible happens that even Pollyanna doesn't know how ot feel glad about it.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=2Vb2YUO_itUC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Eleanor Porter"],firstBook:c,published:"2003-10-30",publisher:"ePenguin",subtitle:a}},{id:10485,attributes:{title:b,description:"When optimistic orphan Pollyanna is sent to live with her stern Aunt Polly in the dismal town of Beldingsville, the sweet-natured eleven year old relies on \"the Glad Game\" to boost her spirits. The Glad Game—which involves looking for the silver lining in every situation—allows her to remain cheerful no matter how coldly and harshly her aunt treats her. Pollyanna teaches the town's residents how to be glad, too, and her sunny outlook soon reanimates the town. Not even strict Aunt Polly is entirely immune to Pollyanna's infectious charm. But when misfortune strikes, Pollyanna will find her irrepressible optimism put to the test. This is an unabridged version of the heartwarming children's tale by American author Eleanor H. Porter, first published in 1913.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=e9GlDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:c,published:"2017-01-01",publisher:"First Avenue Editions ™",subtitle:a}},{id:10486,attributes:{title:b,description:"When orphaned eleven-year-old Pollyanna comes to live with austere and wealthy Aunt Polly, her philosophy of gladness brings happiness to her aunt and other unhappy members of the community.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Vuc8PgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[d],firstBook:c,published:"2002-02-01",publisher:"Turtleback Books",subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940940042}}("","Pollyanna",null,"Eleanor H. Porter"))